import React, {useState} from 'react';
import {Alert, Image, Modal, Pressable, StyleSheet} from 'react-native';

import {Text, View} from '../../components/Themed';
import {RootTabScreenProps} from '../../types';

// noinspection JSUnusedLocalSymbols
export default function TabOneScreen({navigation}: RootTabScreenProps<'TabOne'>) {
  const [modalVisible, setModalVisible] = useState(false);

  const onClick = () => {
    setModalVisible(true);
  }

  const onLogout = () => {
    setModalVisible(!modalVisible);
  }

  return (
    <View style={styles.container}>
      <Modal
        animationType='slide'
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => {
          Alert.alert('Modal has been closed.');

        }}>
        <View style={styles.centeredView}>
          <View style={styles.modalView}>
            <Text style={styles.modalText}>Hello World!</Text>
            <Pressable
              style={[styles.button, styles.buttonClose]}
              onPress={() => setModalVisible(!modalVisible)}>
              <Text style={styles.textStyle}>Hide Modal</Text>
            </Pressable>
          </View>
        </View>
      </Modal>
      <View style={styles.row}>
        <Text style={styles.title}>Good Afternoon</Text>
        <Pressable onPress={onLogout} style={styles.profile}>
          <Image source={{uri: 'https://cdn-icons-png.flaticon.com/512/3135/3135715.png'}} style={styles.img}/>
        </Pressable>
      </View>
      <Text style={styles.description}>Recently Played</Text>
      <View>
        <Text style={styles.description}>Main Song</Text>
      </View>
      <View>
        <Text style={styles.description}>Song List</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginHorizontal: 20,
    marginTop: 30,
  },
  title: {
    fontSize: 32,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  description: {
    fontSize: 20,
  },
  row: {
    flexDirection: 'row',
  },
  profile: {
    width: 50,
    height: 50,
    marginLeft: 25,
    borderRadius: 25,
  },
  img: {
    width: 50,
    height: 50,
  },
  centeredView: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    marginTop: 22,
  },
  modalView: {
    margin: 20,
    backgroundColor: 'white',
    borderRadius: 20,
    padding: 35,
    alignItems: 'center',
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 4,
    elevation: 5,
  },
  button: {
    borderRadius: 20,
    padding: 10,
    elevation: 2,
  },
  buttonOpen: {
    backgroundColor: '#f194ff',
  },
  buttonClose: {
    backgroundColor: '#2196f3',
  },
  textStyle: {
    color: 'white',
    fontWeight: 'bold',
    textAlign: 'center',
  },
  modalText: {
    marginBottom: 15,
    textAlign: 'center',
  },
});
